  <title>daimon agent</title>
  <link href="https://fonts.googleapis.com/css2?family=IBM+Plex+Mono:wght@300;400;500&display=swap" rel="stylesheet">
  <style>
    :root {
      --bg: #060608;
      --surface: #0d0d10;
      --border: #1a1a20;
      --text: #d4d4d8;
      --secondary: #71717a;
      --dim: #3f3f46;
      --faint: #27272a;
      --green: #4ade80;
      --red: #fca5a5;
      --amber: #fbbf24;
      --font: 'IBM Plex Mono', monospace;
    }

    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box
    }

    body {
      background: var(--bg);
      color: var(--text);
      font-family: var(--font);
      font-size: 13px;
      line-height: 1.7;
      -webkit-font-smoothing: antialiased
    }

    a {
      color: var(--green);
      text-decoration: none
    }

    a:hover {
      opacity: 0.8
    }

    ::selection {
      background: rgba(74, 222, 128, 0.15)
    }

    .page {
      max-width: 640px;
      margin: 0 auto;
      padding: 0 24px
    }

    /* identity */
    .identity {
      display: flex;
      align-items: center;
      gap: 20px;
      padding: 40px 0 24px
    }

    .face {
      width: 72px;
      height: 72px;
      border-radius: 50%;
      border: 1px solid var(--faint);
      object-fit: cover;
      background: var(--surface)
    }

    .id-name {
      font-size: 20px;
      font-weight: 400;
      color: var(--text);
      margin-bottom: 2px
    }

    .id-sub {
      font-size: 11px;
      color: var(--secondary);
      line-height: 1.6
    }

    .role-badge {
      display: inline-block;
      font-size: 10px;
      color: var(--green);
      border: 1px solid var(--green);
      padding: 2px 8px;
      border-radius: 100px;
      margin-top: 6px;
      opacity: 0.7
    }

    /* status */
    .status-bar {
      display: flex;
      align-items: center;
      gap: 10px;
      padding: 14px 18px;
      background: var(--surface);
      border: 1px solid var(--border);
      border-radius: 6px;
      margin-bottom: 16px
    }

    .dot {
      width: 8px;
      height: 8px;
      border-radius: 50%;
      background: var(--dim);
      flex-shrink: 0
    }

    .dot.alive {
      background: var(--green);
      animation: pulse 2s ease-in-out infinite;
      box-shadow: 0 0 8px rgba(74, 222, 128, 0.3)
