    .dot.idle {
      background: var(--amber)
    }

    .dot.offline {
      background: var(--red);
      opacity: 0.5
    }

    @keyframes pulse {

      0%,
      100% {
        opacity: 1
      }

      50% {
        opacity: 0.5
      }
    }

    .status-text {
      font-size: 12px;
      color: var(--text)
    }

    .status-detail {
      font-size: 11px;
      color: var(--dim);
      margin-left: auto
    }

    /* token card */
    .token-card {
      background: var(--surface);
      border: 1px solid var(--border);
      border-radius: 6px;
      padding: 16px 18px;
      margin-bottom: 16px;
      display: none
    }

    .token-row {
      display: flex;
      align-items: center;
      gap: 12px;
      flex-wrap: wrap
    }

    .token-sym {
      color: var(--green);
      font-weight: 500;
      font-size: 14px
    }

    .token-price {
      color: var(--text);
      font-size: 13px
    }

    .token-change {
      font-size: 11px;
      font-weight: 500
    }

    .token-change.up {
      color: var(--green)
    }

    .token-change.down {
      color: var(--red)
    }

    .token-actions {
      margin-left: auto;
      display: flex;
      gap: 8px;
      font-size: 11px
    }

    .token-actions a {
      color: var(--dim);
      border: 1px solid var(--border);
      padding: 3px 10px;
      border-radius: 100px
    }

    .token-actions a:hover {
      color: var(--green);
      border-color: var(--green)
    }

    .token-addr {
      font-size: 10px;
      color: var(--faint);
      margin-top: 8px;
      word-break: break-all
    }

    /* network stats */
    .network-stats {
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 1px;
      margin-bottom: 16px;
      background: var(--border);
      border-radius: 6px;
      overflow: hidden
    }

    .network-stat {
      background: var(--surface);
      padding: 12px 16px
    }

    .network-stat-val {
      font-size: 18px;
      color: var(--text);
      font-weight: 400
    }

    .network-stat-label {
      font-size: 10px;
      color: var(--dim);
      text-transform: uppercase;
      letter-spacing: 1px;
      margin-top: 2px
    }

    /* stats */
    .stats {
      display: grid;
      grid-template-columns: 1fr;
      gap: 1px;
      margin-bottom: 24px
    }

    .stat {
      background: var(--surface);
      padding: 12px 16px
    }

    .stat:first-child {
      border-radius: 6px 0 0 6px
    }

    .stat:last-child {
      border-radius: 0 6px 6px 0
    }

    .stat-val {
      font-size: 13px;
      color: var(--text);
      word-break: break-all
    }

    .stat-label {
      font-size: 10px;
      color: var(--dim);
      text-transform: uppercase;
      letter-spacing: 1px;
      margin-bottom: 2px
    }

    /* about */
    .about {
      background: var(--surface);
      border: 1px solid var(--border);
      border-radius: 6px;
      padding: 16px 18px;
      margin-bottom: 16px;
      font-size: 12px;
      color: var(--secondary);
      line-height: 1.8;
      display: none
    }

    /* infrastructure */
    .infrastructure {
      background: var(--surface);
      border: 1px solid var(--border);
      border-radius: 6px;
      padding: 16px 18px;
      margin-bottom: 16px;
      display: none
    }

    .infra-title {
      font-size: 10px;
      text-transform: uppercase;
      letter-spacing: 1.5px;
      color: var(--dim);
      margin-bottom: 12px
    }

    .infra-grid {
      display: grid;
      gap: 8px
    }

    .infra-item {
      display: flex;
      align-items: baseline;
      gap: 8px;
      font-size: 11px
    }

    .infra-name {
      color: var(--text);
      font-weight: 500
    }

    .infra-desc {
      color: var(--secondary);
      flex: 1
    }

    .infra-status {
      font-size: 10px;
      padding: 2px 6px;
      border-radius: 100px;
      background: var(--border);
      color: var(--dim)
    }

    .infra-status.ready {
      background: rgba(74, 222, 128, 0.1);
      color: var(--green)
    }

    /* activity */
    .section-label {
      font-size: 10px;
      text-transform: uppercase;
      letter-spacing: 1.5px;
      color: var(--dim);
      margin-bottom: 10px
    }

    .activity {
      margin-bottom: 24px
    }

    .commit {
      display: flex;
      align-items: baseline;
      gap: 10px;
      padding: 7px 0;
      border-bottom: 1px solid var(--border);
      font-size: 11px
    }

    .commit:last-child {
      border-bottom: none
    }

    .commit-sha {
      color: var(--faint);
      font-family: var(--font);
      flex-shrink: 0
    }

    .commit-msg {
      color: var(--text);
      flex: 1;
      white-space: nowrap;
      overflow: hidden;
      text-overflow: ellipsis
    }

    .commit-time {
      color: var(--dim);
      flex-shrink: 0;
      font-size: 10px
    }

    /* links */
    .links {
      display: flex;
      gap: 12px;
      margin-bottom: 24px;
      font-size: 11px
    }

    .links a {
      color: var(--dim);
      border: 1px solid var(--border);
      padding: 6px 14px;
      border-radius: 100px
    }

    .links a:hover {
      color: var(--green);
      border-color: var(--green)
    }

    /* footer */
    .footer {
      text-align: center;
      padding: 20px 0 40px;
      font-size: 10px;
      color: var(--dim)
    }
  </style>
</head>

<body>
  <div class="page">

    <div class="identity">
