        <div class="network-stat-val" id="network-chain">Base</div>
        <div class="network-stat-label">network</div>
      </div>
    </div>

    <div class="stats">
      <div class="stat">
        <div class="stat-label">repo</div>
        <div class="stat-val"><a id="repo-link" href="#" target="_blank"></a></div>
      </div>
